    public static String imageToBase64(File file) {
        //Base64
       String image = ImgUtil.toBase64(ImgUtil.read(file), ImgUtil.IMAGE_TYPE_JPG);
       return image;
    }

    //base64
    public static boolean base64ToImage(String imgStr, File file) {
        //Base64
        if (imgStr == null) //
            return false;
        BASE64Decoder decoder = new BASE64Decoder();
        try {
            //Base64
            byte[] b = decoder.decodeBuffer(imgStr);
            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {//
                    b[i] += 256;
                }
            }
            OutputStream out = new FileOutputStream(file);
            out.write(b);
            out.flush();
            out.close();
            return true;
        } catch (Exception e) {
            return false;
        }
    }

    public static File compress(File file) {

        BufferedImage src = null;
        FileOutputStream out = null;
        ImageWriter imgWrier;
        ImageWriteParam imgWriteParams;
        System.out.println("");
        //  jpg
        imgWrier = ImageIO.getImageWritersByFormatName("jpg").next();
        imgWriteParams = new javax.imageio.plugins.jpeg.JPEGImageWriteParam(
                null);
        // MODE_EXPLICIT
        imgWriteParams.setCompressionMode(imgWriteParams.MODE_EXPLICIT);

        imgWriteParams.setProgressiveMode(imgWriteParams.MODE_DISABLED);
        try {
            ColorModel colorModel = ImageIO.read(file).getColorModel();// ColorModel.getRGBdefault();
            // 
            //        imgWriteParams.setDestinationType(new javax.imageio.ImageTypeSpecifier(
            //                colorModel, colorModel.createCompatibleSampleModel(16, 16)));
            imgWriteParams.setDestinationType(new javax.imageio.ImageTypeSpecifier(
                    colorModel, colorModel.createCompatibleSampleModel(16, 16)));

            System.out.println("");
            if (!file.exists()) {
                System.out.println("Not Found Img File,");
                throw new FileNotFoundException("Not Found Img File,");
            } else {
                long len = file.length();
                System.out.println("" + len + "");

                // qality0~1
                float qality = 40000f / len;
                System.out.println("qality" + qality + "");
                imgWriteParams.setCompressionQuality(qality);


                src = ImageIO.read(file);
                out = new FileOutputStream(file);

                imgWrier.reset();
                //  outwrite, ImageOutputStream
                // OutputStream
                imgWrier.setOutput(ImageIO.createImageOutputStream(out));
                // write
                imgWrier.write(null, new IIOImage(src, null, null),
                        imgWriteParams);
                out.flush();
                out.close();
                System.out.println("" + file.length() + "");

                return file;
            }
        } catch (Exception e) {
            e.printStackTrace();
            return null;
        }
    }

